window.bookSummaryJSON = "<p>New year, new magic?</p> <p>A witch can make resolutions, too…right?</p> <p>Psh. First, I have to get to the new year. Just when I thought everything was going perfect...BOOM. Problems. And not just any problems—missing children problems. One of them is my soulmate’s little cousin, which is bad enough for my anxiety, but the other is a young cousin of the shifter king. Not like that’s a significant detail or anything.</p> <p>Now, we’re in a race with time to find them, but something tells me our problems are only just beginning.</p> <p>Don't miss the epic finale in Emersyn and Deacon's eventful experience in <i>The Empire Witch.</i></p>"; 
